import React from "react";
import { IReview } from "../reviews";
import { Container, UserImg, UserName, Wrap } from "./styled";

export default function Review(props: IReview) {
  return (
    <Wrap>
      <UserImg $backgroundImg={props.userImgUrl} />
      <Container>
        <UserName></UserName>
      </Container>
    </Wrap>
  );
}
